import React, { useState } from 'react'
import Axios from 'axios';
import MainLayout from '../layout/MainLayout'

function Dashboard() {
    const [useremail, getEmail] =useState("");
    const [phoneNum, getPhoneNum] =useState("");
    const [myArray, setMyArray] = useState([]);
    let data;

    const getUNAccounts=()=>{
   Axios.post("http://localhost:3001/dashboard",{
   }).then((response)=>{
    if(response.data.message){
      console("Data not recived")
    }
    else{
        console.log(response.data);
        data = response.data;
        console.log(data);
        getEmail(data[0].Email)
        getPhoneNum(data[0].Phone)
        setMyArray(data)
    }
   });
    }

    getUNAccounts();
   // console.log(myArray);

    // getEmail(data[0].Email);
    // getPhoneNum(data[0].Phone);

  return (
    <MainLayout>
        <div className="border"></div>
        <div className="prod-wrapper" >



            <div className="prod_browse">
                <h2>Dashboard</h2>
                <button onClick={getUNAccounts}>Get data</button>
                <table>
                    <thead>
                        <tr>
                            <th>Email</th>
                            <th>Phone Number</th>
                            <th>Action</th>
                        </tr>
                    </thead>
                    <tbody id="userTableBody">
                    <tr className='user-info'>
                            <td>
                                {useremail}
                            </td>
                            <td>
                            {phoneNum}
                            </td>
                            <td>
                                <button className='accept'>Accept</button>
                                <button className='reject'>Reject</button>
                            </td>
                        </tr>
                    </tbody>
                </table>
            </div>

        </div>
    </MainLayout>

  )
}

export default Dashboard
